-- Si hacen varias pruebas no se olviden de desactivar que muestre el plan de ejecucion 
-- porque sino va a tardar mucho debido a que registra el plan para los 1000 INSERT

SET ANSI_NULLS ON
SET QUOTED_IDENTIFIER ON


CREATE TABLE [dbo].[PruebaNumeradores](
	[Nombre] [varchar](255) NULL,
	[FechaIngreso] [datetime] NULL,
	[Correo] [varchar](255) NULL,
	[Pais] [varchar](100) NULL
) ON [PRIMARY]
GO

CREATE NONCLUSTERED INDEX IX_PruebaNumeradores_Nombre ON PruebaNumeradores(Nombre)
GO

/*
===========================================================================================
						POR FAVOR INSERTAR LOS REGISTROS MEDIANTE LOS INSERT QUE SE 
						ENCUENTRAN AL FINAL DEL SCRIPT ANTES DE CONTINUAR CON EL 
						RESTO DEL SCRIPT.
===========================================================================================
*/



-- Muestra las stadisticas de IO
set statistics io on
go

--------------------------------------------------------------------------
-- Habilitar tambien el boton para ver el plan de ejecución actual 
--------------------------------------------------------------------------


-- Numerar filas mediante un subquery
Select 
				(
					select COUNT(*) 
					from PruebaNumeradores AS s 
					where s.Nombre <= p.nombre 
				) as id,
				* 
from		
			PruebaNumeradores p
order by 
					nombre;			-- Es necesario ordenar para poder contar con el subquery
go

---------------------------------------------------------------------
-- Numerar filas mediante un ROW_NUMBER() con clausula ORDER BY
---------------------------------------------------------------------
Select
       ROW_NUMBER() OVER (ORDER BY a.nombre ) as id,
       A.* 
from 
       PruebaNumeradores a;

go

-- No se puede sacar la clausula ORDER BY
Select
       ROW_NUMBER() OVER () as id,
       A.* 
from 
       PruebaNumeradores a
go

--Msg 4112, Level 15, State 1, Line 1047
--The function 'ROW_NUMBER' must have an OVER clause with ORDER BY.


---------------------------------------------------------------------
-- Usando un literal en la clausula ORDER BY del ROW_NUMBER()
---------------------------------------------------------------------
Select
       ROW_NUMBER() OVER (ORDER BY (select 1)) as id,
       A.* 
from 
       PruebaNumeradores a

go


---------------------------------------------------------------------
-- Una alternativa usando Identity (que no funciona)
---------------------------------------------------------------------
Select
       IDENTITY(int,1,1) as id,
       A.* 
from 
       PruebaNumeradores a

--Msg 177, Level 15, State 1, Line 1067
--The IDENTITY function can only be used when the SELECT statement has an INTO clause.
go



---------------------------------------------------------------------
-- Se debe usar una tabla temporal intermedia por lo que es menos 
-- eficiente que la anterior
---------------------------------------------------------------------
Select
       IDENTITY(int,1,1) as id,
       A.* 
into #PruebaNumeradoresTmp
from 
       PruebaNumeradores a


-- Y devolvemos el resultado
Select 
				* 
from  
				#PruebaNumeradoresTmp
order by 
				id


---------------------------------------------------------------------
-- Eliminamos la tabla 
---------------------------------------------------------------------
drop table #PruebaNumeradoresTmp
GO

set statistics io off
go
			  

